import React from "react";
import { motion } from "framer-motion";
import { FaEnvelope, FaPhone, FaMobileAlt, FaLaptopCode, FaLinkedin, FaGithub } from "react-icons/fa";
import myProfile from "../src/img/myProfile.JPG";

export default function Portfolio() {
  return (
    <div className="container mx-auto px-6 flex flex-col-reverse lg:flex-row items-center justify-between py-12">
      {/* Left Section */}
      <div className="text-center lg:text-left w-full lg:w-1/2">
        <motion.h1
          className="text-4xl sm:text-5xl md:text-6xl font-bold mb-4 text-gray-800"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1 }}
        >
          Chiranjeevi Kumar
        </motion.h1>
        <p className="text-lg sm:text-xl italic text-gray-600 mb-2">
          <span className="font-bold text-green-600">Mobile Developer</span> | React Native | Swift | Kotlin
        </p>
        <p className="text-base sm:text-lg text-gray-700 mb-6 leading-relaxed">
          Passionate about crafting seamless and high-performance mobile applications. 
          Specialized in **iOS & Android development**, API integrations, and UI/UX optimization.
        </p>

        <motion.div
          className="mb-6"
          initial={{ opacity: 0, x: -20 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 1, delay: 0.5 }}
        >
          <p className="text-base sm:text-lg text-gray-600 mb-4">
            **Key Skills:** React Native, Swift, Kotlin, Firebase, REST APIs, GraphQL, Redux, TailwindCSS, Payment Integration.
          </p>
          <p className="text-base sm:text-lg text-gray-600">
            **Recent Projects:**  
            - üöó **EV Charging App**: Implemented real-time station availability & payments.  
            - üè¶ **Fintech Wallet**: Developed secure transactions & biometric authentication.  
            - üõçÔ∏è **E-commerce App**: Integrated Stripe for a smooth checkout experience.  
          </p>
        </motion.div>

        <motion.button
          className="bg-green-600 hover:bg-green-700 text-white font-semibold px-6 py-3 rounded-lg flex items-center gap-2 mx-auto lg:mx-0 transition-all shadow-md hover:scale-105"
          whileHover={{ scale: 1.05 }}
          transition={{ duration: 0.2 }}
        >
          Let‚Äôs Collaborate <span className="text-orange-400">üöÄ</span>
        </motion.button>

        {/* Contact Info */}
        <motion.div 
          className="mt-6 flex flex-col sm:flex-row gap-4 sm:gap-6 items-center justify-center lg:justify-start"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1, delay: 0.7 }}
        >
          <a href="tel:+917870503085" className="flex items-center gap-2 hover:text-green-600 transition-all">
            <FaPhone className="text-green-600" />
            <p className="font-semibold text-sm sm:text-base">+91 7870503085</p>
          </a>
          <a href="mailto:chiranjeeviraj109@gmail.com" className="flex items-center gap-2 hover:text-green-600 transition-all">
            <FaEnvelope className="text-green-600" />
            <p className="font-semibold text-sm sm:text-base">chiranjeeviraj109@gmail.com</p>
          </a>
        </motion.div>

        {/* Social Links */}
        <div className="mt-6 flex gap-4 justify-center lg:justify-start">
          <a href="#" className="text-gray-600 hover:text-green-600 transition-all text-2xl">
            <FaLinkedin />
          </a>
          <a href="#" className="text-gray-600 hover:text-green-600 transition-all text-2xl">
            <FaGithub />
          </a>
        </div>
      </div>

      {/* Profile Image */}
      <motion.div
        className="relative w-44 h-44 sm:w-56 sm:h-56 lg:w-72 lg:h-72 mb-6 lg:mb-0 overflow-hidden rounded-full shadow-lg"
        initial={{ scale: 0.8, opacity: 0 }}
        animate={{ scale: 1, opacity: 1 }}
        transition={{ duration: 1 }}
      >
        <img src={myProfile} alt="Profile" className="w-full h-full object-cover" />
        <div className="absolute inset-0 bg-gradient-to-r from-green-500 to-blue-500 opacity-30"></div>
      </motion.div>
    </div>
  );
}
